import React, { useState } from 'react';
import Window from '../components/window';

export default function Main() {
  const [maxZIndex, setMaxZIndex] = useState(0);
  const [windows, setWindows] = useState([]);
  return (
    <>
      <Window
        category="main"
        maxZIndex={maxZIndex}
        setMaxZIndex={setMaxZIndex}
      />
      {windows.map((window) => {
        return (
          <Window
            category="chat-room"
            maxZIndex={maxZIndex}
            setMaxZIndex={setMaxZIndex}
          />
        );
      })}
    </>
  );
}
